@pit_lane_news_awom Fulgence Rudakubana, a former Rwandan military officer, who was involved in the 1994 Rwandan Genocide. During that time, he worked closely with various law enforcement and military agencies as part of the government force involved in the genocide. Specifically, Rudakubana was known to have been a prominent figure in the local government structure and had connections with both military and police officials.
He was said to have held significant sway over local law enforcement agencies, leveraging those connections to execute the genocidal policies against the Tutsi population. His links to law enforcement were instrumental in coordinating and directing violent campaigns during the genocide.
After the genocide, many such individuals, including Rudakubana, fled Rwanda to escape justice. Some were later pursued by international law enforcement agencies and brought to trial for their roles in the genocide. However, capturing and prosecuting individuals like Rudakubana has often been complicated by the lack of cooperation from countries where these individuals have sought refuge.

